const UserInputs = () => {
  return (
    <div>
      <p>
        <label>User</label>
        <input type="text" placeholder="add name" />
      </p>
      <p>
        <label>Age</label>
        <input type="number" placeholder="add age" />
      </p>
    </div>
  );
};

export default UserInputs;
